import ImageOne from '../Images/Hamburger.png';
import ImageTwo from '../Images/pizza.png';
import ImageThree from '../Images/sandwich.png';

export const SliderData=[
    {
        title:'Hamburger',
        price:'20$',
        path:'/homes',
        label:'View Home',
        image:ImageOne,
        alt:'Hamburger'
    },
    {
        title:'Pizza',
        price:'20$',
        path:'/homes',
        label:'View Home',
        image:ImageTwo,
        alt:'Hamburger'
    },
    {
        title:'Sandwich',
        price:'20$',
        path:'/homes',
        label:'View Home',
        image:ImageThree,
        alt:'Hamburger'
    }
]
